Unearthing Ancient Secrets: Collection 1
New forensic techniques are altering our understanding of the past, and helping to resolve mysteries about the lives of some of the greatest figures in history. In this series, leading experts from around the world apply modern forensic techniques to re-examine the myths and mysteries that have fascinated us for centuries. Among the iconic subjects covered in the series are Tutankhamun's mysterious death, the lives of gladiators in ancient Rome, the fate of Khubilai Khan's fleet, the mystery of the Sphinx, the assassination of Julius Caesar, the alleged suicide of Cleopatra, the identity of Jack the Ripper, and the survivors of the Great Plague


1)  The Unsolved Death of Cleopatra 
For 2000 years, only one verdict has been recorded-suicide by snakebite. Scientific evidence suggests this is not how Cleopatra died. Criminal Profiler Pat Brown and a team of experts apply 21st century forensic analysis to re-open the investigation.

2)  Egypts Mystery Tomb 
When the tomb of King Tut was found in 1922, many believed the Valley of the Kings had given up all its secrets. Now, archaeologists have found a new tomb just a few metres away. We will follow the experts as they discover just what, or who, lies inside.

3)  Khubilai Khans Lost Fleet 
In 1281, Khubilai Khan, built the world's largest fleet. In one night, 4,000 ships sank in a hurricane and were destroyed. A team of underwater archaeologists has discovered a ship that could be from that fleet. Forensic analysis will tell the true story.

4)  Alexander the Great a Case of Murder 
Suspicion has surrounded the untimely demise of Alexander the Great since the day he died. Now modern science could finally tell us what really happened. This film pieces together the forensic evidence to solve a 2,300 year old murder mystery.

5)  True Gladiator 
The blood of Roman Gladiators kept an Empire entertained for more than 500 years. This film joins a team of forensic scientists to analyze their skeletons, expose the myths and resurrect the life of a real Gladiator.

6)  Who Killed Julius Caesar 
In the first ever application of modern science to the murder of Julius Caesar, this film uses the latest Crime Scene Investigation techniques, computer reconstruction technology, and experts to reveal a shocking new assessment of the truth.

7)  Secrets of the Great Plague 
Through a series of groundbreaking experiments and archaeological discoveries, we show how the Great Plague's survivors could hold the key to fighting the infectious diseases of the 21st century, and how our bodies could teach us to outsmart new infection

8)  Jack the Ripper 
Jack The Ripper's reign of terror remains one of history's greatest mysteries. With the benefits of modern criminology and psychological analysis, we use 21st century techniques to understand a 19th century killer. The results completely change the game

9)  The Sphinx Unmasked 
Dr Vassil Dobrev sets out to discover the truth about the Sphinx. Does it really represent the pharaoh Khafre? Using scientific techniques, Vassil finds a different explanation. That the Sphinx was created by a by a pharaoh that history forgot: Djedefre.

10)  King Tuts Mysterious Death 
Two former FBI agents take on their coldest case yet: the death of Tutankhamun. Using cutting edge science they spend almost four years investigating. Will a CT scan of his mummy finally reveal a cause of death? Was Tut murdered?

11)  Columbus the Hidden Mystery 
Christopher Columbus is one of history's most famous explorers. The world knows about his discoveries, but not about him or where he comes from. Using the latest technology to examine the explorer's bones, and uncover historic evidence never seen before.

12)  Engineering Ancient Rome 
The center of one of the greatest civilizations, Rome was a modern city in an ancient world. They built the Colosseum and Pantheon, supplied 1 million residents with fresh water every day - all achieved with manpower and the most basic machinery. But how?

13)  A Warriors Autopsy 
Philip of Macedonia, father of Alexander the Great, built one of the ancient world's greatest militaries, but what was life really like for his soldiers? A team investigates the skeleton of an ancient warrior to reveal the mysterious cause of death.

14)  Engineering Ancient Egypt 
The Great Pyramid is not only a Wonder of the Ancient World but was also the world's tallest man-made structure for 3,800 years. Egyptians built this and more with only manpower. Engineering experts work to decode construction the way the ancients did it.

15)  The Search for Sheba 
An investigation has been launched to find a missing person - the legendary, Biblical figure we know as the Queen of Sheba. Immortalized as the lover of King Solomon, who was she? A team excavating an ancient temple believes they have unearthed answers.

16)  Rameses a Murder Mystery 
In the Valley of the Kings a discovery could change our view of the Bible forever. Rameses II was the pharaoh of the Exodus, whose firstborn son died during the 10th plague. New evidence suggests the heir may have been killed by something more sinister.

17)  Secrets of the Valley of the Kings 
In the Valley of the Kings lie tombs of some of the greatest Pharaohs of Ancient Egypt. After 3000 years the secrets of how the Ancient Egyptian craftsmen managed to build such an elaborate subterranean world are being unearthed.

